import { Link } from '@material-ui/core';
import React from 'react';
import './Navbar2.css';
import searchIcon from '../../images/search.png';
import { useHistory } from 'react-router';

const Navbar2 = () => {
    const history = useHistory();
    const handleLogo = () => {
        history.push('/');
    }

    const checkIn = sessionStorage.getItem('checkIn');
